    false,nt"url": null,nt"notes": "The USGS NAIP Plus service from The National
    Map consists of National Agriculture Imagery Program (NAIP) and high resolution
    orthoimagery (HRO) that combine the visual attributes of an aerial photograph with
    the spatial accuracy and reliability of a map. Digital orthoimage resolution may
    vary from 6 inches to 1 meter. In the former resolution, every pixel in an orthoimage
    covers a six inch square of the earthu00e2u0080u0099s surface, while in the latter
    resolution, each pixel represents a one meter square. Many states contribute orthoimagery
    to The National Map, and the USGS also relies on a partnership with the U.S. Department
    of Agriculture's Farm Service Agency. The National Map download client allows free
    downloads of public domain, 1-meter resolution orthoimagery in JPEG 2000 (jp2) format
    for the conterminous United States, with many urban areas and other locations at
    1-foot (or better) resolution also in JPEG 2000 (jp2) format. For additional information
    on imagery products, go to https://lta.cr.usgs.gov/node/300 and https://lta.cr.usgs.gov/high_res_ortho/.",nt"license_title":
